import React, { useState, useEffect } from "react";
import axios from 'axios'
import "./App.css";
import Header from "./components/Header/Header";


function App() {
const [data, setData] = useState([])
const srcId = `https://www.youtube.com/watch?v=${data.id}`
  useEffect(() => {
    axios.get(`https://www.googleapis.com/youtube/v3/videos`, {
      params: {
        part: "snippet",
        key: "AIzaSyCeQDuZBJ00R2kC0cqvxWX86ZcVfpB7HVY",
        chart: "mostPopular",
        maxResults: 10
      }
    })
      .then(res => setData(res.data.items[0]))
  }, [])
  console.log(srcId)

 return (
   <>
   <Header />
   <ifrae src={srcId} frameborder="0" width="500px" height="500px" />
   <video src={srcId}></video>
   </>
 )
}

export default App;
